import * as React from 'react';
import Box from '@mui/material/Box';
import { Typography } from '@mui/material';

const jobList = [
  { title: '05 Developers (ReactJS, NodeJS)', skills: 'HTML\nWaterfall\nTest Driven development\nNodeJS' },
  { title: 'Full Stack Software Engineer', skills: 'Independent Learner\nGrunt\nGCP' },
  { title: 'Full-Stack Engineer - Open to U.S. Remote', skills: 'Open Minded\nSuccess Driven\nRedux' },
  { title: 'Full Stack Software Engineer', skills: 'REST\nMotivated\nPython' },
  { title: 'React Native Dev (JavaScript, ReactJS)', skills: 'Independent Learner\nJenkins' },
];

export default function CenteredBoxes() {
  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      minHeight="100vh"
    >
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        flexWrap="wrap"
        gap={2}
      >
        {jobList.map((job, index) => (
          <Box
            key={index}
            height={200}
            width={300}
            display="flex"
            flexDirection="column"
            justifyContent="center"
            p={2}
            borderRadius={3}
            sx={{ border: '2px solid grey', textAlign: 'center' }}
          >
            <Typography>
              {job.title}
            </Typography>
            <Box sx={{ mt: 2 }}>
              {job.skills.split('\n').map((skill, i) => (
                <Typography key={i}>
                  {skill}
                </Typography>
              ))}
            </Box>
          </Box>
        ))}
      </Box>
    </Box>
  );
}
